function LiveBirth() {
    const {dataToMap,mapPeriods}=useContext(LiveBirthContext)

    return (
        <div>

            {/* <SubdivisionFilter></SubdivisionFilter> */}
     <HighChartDemo data={dataToMap} chartType="column" period={mapPeriods}></HighChartDemo>

        </div>
    )
}

export default LiveBirth
